CREATE TABLE IF NOT EXISTS Tally(
   DAO                 VARCHAR(23) NOT NULL PRIMARY KEY
  ,Proposal_Threshold  VARCHAR(7) NOT NULL
  ,network             VARCHAR(8)
  ,Quorum_Needed       VARCHAR(7) NOT NULL
  ,Proposal_Delay      VARCHAR(13) NOT NULL
  ,Voting_Period       VARCHAR(8) NOT NULL
  ,Governor_Address    VARCHAR(42) NOT NULL
  ,Token_Address       VARCHAR(42) NOT NULL
  ,Timelock_Address    VARCHAR(42) NOT NULL
  ,Total_Token_Supply  VARCHAR(17) NOT NULL
  ,dao_type            VARCHAR(6) NOT NULL
  ,Number_of_Proposals INTEGER  NOT NULL
  ,Number_of_Holders   VARCHAR(7) NOT NULL
  ,Number_of_Voters    VARCHAR(6) NOT NULL
  ,Total_Passed        INTEGER  NOT NULL
  ,Total_Failed        INTEGER  NOT NULL
  ,Success_Rate        VARCHAR(23) NOT NULL
);
